      string: "{\"docs\":[{\"_id\":\"5cd96e05de30eff6ebcce8e3\",\"dialog\":\"One that
        is cursed. Long ago the men of the mountains swore an oath to the last King
        of Gondor, to come to his aid, to fight. But when the time came, when Gondor's
        need was dire, they fled vanishing into the darkness of the mountain. And
        so Isildur cursed them, never to rest until they had fulfilled their pledge.
        Who shall call them from the grey twilight, the forgotten people? The heir
        of him to whom the oath they swore. From the North shall he come, need shall
        drive him. He shall pass the door to the Paths of the Dead.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce8e3\"},{\"_id\":\"5cd96e05de30eff6ebcce8e7\",\"dialog\":\"The
        way is shut. It was made by those who are dead, and the dead keep it. The
        way is shut.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce8e7\"},{\"_id\":\"5cd96e05de30eff6ebcce900\",\"dialog\":\"I
        see shapes of men and of horses.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce900\"},{\"_id\":\"5cd96e05de30eff6ebcce902\",\"dialog\":\"Pale
        banners like shreds of cloud. Spears rise like winter thickets through a shroud
        of mist. The dead are following. They have been summoned.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce902\"},{\"_id\":\"5cd96e05de30eff6ebcce922\",\"dialog\":\"The
        horses are restless and the men are quiet.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce922\"},{\"_id\":\"5cd96e05de30eff6ebcce925\",\"dialog\":\"It
        is the road to the Dimholt, the door under the mountain.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce925\"},{\"_id\":\"5cd96e05de30eff6ebcce96c\",\"dialog\":\"Have
        you learnt nothing of the stubbornness of dwarves?\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce96c\"},{\"_id\":\"5cd96e05de30eff6ebcce9f2\",\"dialog\":\"Final
        count.....42.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce9f2\"},{\"_id\":\"5cd96e05de30eff6ebcce9f4\",\"dialog\":\"Forty-three.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce9f4\"},{\"_id\":\"5cd96e05de30eff6ebcce9fa\",\"dialog\":\"He
        was twitching.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcce9fa\"},{\"_id\":\"5cd96e05de30eff6ebccea6b\",\"dialog\":\"Aragorn!\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccea6b\"},{\"_id\":\"5cd96e05de30eff6ebccea92\",\"dialog\":\"Your
        friends are with you, Aragorn.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccea92\"},{\"_id\":\"5cd96e05de30eff6ebccea98\",\"dialog\":\"Shall
        I describe it to you? Or would you like me to find you a box?\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccea98\"},{\"_id\":\"5cd96e05de30eff6ebccea9f\",\"dialog\":\"Faeg
        i-varv d'n na lanc a nu ranc.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccea9f\"},{\"_id\":\"5cd96e05de30eff6ebcceaaa\",\"dialog\":\"I'm
        on 17!\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcceaaa\"},{\"_id\":\"5cd96e05de30eff6ebcceaaf\",\"dialog\":\"Nineteen!\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcceaaf\"},{\"_id\":\"5cd96e05de30eff6ebcceb2d\",\"dialog\":\"Le
