        scout!\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcceb8a\"},{\"_id\":\"5cd96e05de30eff6ebccebcb\",\"dialog\":\"Aragorn!\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccebcb\"},{\"_id\":\"5cd96e05de30eff6ebccebcd\",\"dialog\":\"You
        lie.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccebcd\"},{\"_id\":\"5cd96e05de30eff6ebccec08\",\"dialog\":\"What
