        three, thirty four.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccec50\"},{\"_id\":\"5cd96e05de30eff6ebccec74\",\"dialog\":\"Come
        on, Gimli!\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccec74\"},{\"_id\":\"5cd96e05de30eff6ebccec76\",\"dialog\":\"Come,
        Gimli! We're gaining on them!\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccec76\"},{\"_id\":\"5cd96e05de30eff6ebccec7e\",\"dialog\":\"They
        may yet be alive.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccec7e\"},{\"_id\":\"5cd96e05de30eff6ebcceca1\",\"dialog\":\"They've
        run as if the very whipsof their masters were behind them.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcceca1\"},{\"_id\":\"5cd96e05de30eff6ebccecd8\",\"dialog\":\"The
        Uruks turn northeast.They are taking the Hobbits to lsengard.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccecd8\"},{\"_id\":\"5cd96e05de30eff6ebcced99\",\"dialog\":\"A
        red sun rises.Blood has been spilled this night.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcced99\"},{\"_id\":\"5cd96e05de30eff6ebcceda2\",\"dialog\":\"You
        would die before your stroke fell.\",\"movie\":\"5cd95395de30eff6ebccde5b\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebcceda2\"},{\"_id\":\"5cd96e05de30eff6ebccedad\",\"dialog\":\"Your
        kinsmen may have no need to ride to war. I fear war already marches on their
        own lands.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccedad\"},{\"_id\":\"5cd96e05de30eff6ebccedce\",\"dialog\":\"A
        diversion.\",\"movie\":\"5cd95395de30eff6ebccde5d\",\"character\":\"5cd99d4bde30eff6ebccfd81\",\"id\":\"5cd96e05de30eff6ebccedce\"},{\"_id\":\"5cd96e05de30eff6ebccee03\",\"dialog\":\"Govannas
